('GRID', 296, 359, 30, '', '\n	$.ajax({\n		type : \"POST\",\n		url : url_{G.GRPID}_{G.FNCID} + \"&\" + lastinput{G.GRPID} ,\n		data : sendFormData,\n		processData: false,\n		contentType: false,\n		dataType: \"json\",\n		async: false,\n		success: function(data){\n			alog(\"   json return----------------------\");\n			alog(\"   json data : \" + data);\n			alog(\"   json RTN_CD : \" + data.RTN_CD);\n			alog(\"   json ERR_CD : \" + data.ERR_CD);\n			//alog(\"   json RTN_MSG length : \" + data.RTN_MSG.length);\n\n			//그리드에 데이터 반영\n			saveToGroup(data);\n\n		},\n		error: function(error){\n			msgError(\"Ajax http 500 error ( \" + error + \" )\");\n			alog(\"Ajax http 500 error ( \" + error + \" )\");\n		}\n	});\n	', '', '', '', 'R', '', '', '20180108230146', '20180718083236'),
