(265, 3, 4, 'selMasD', 'MAS', 3, 'R', 'RTN_SELECT_ONE', 0, 'select \n	\'LINESTART\' as MYRADIO, \'LINESTART,LINEEND\' as MYCHECK, \'20191212\' as ADD_DT\nfrom \n	CG_CODE\nwhere PCD = #{G2-PCD}\norder by ORD asc', NULL, '20190527074349', '20190528055432'),
(266, 3, 78, 'selMasG', 'MAS', 3, 'R', 'RTN_SELECT_LIST', 0, 'select \n	0 as CHK, PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT,MODDT\nfrom \n	CG_CODE\norder by ORD asc', 0, '20190528215719', '20190610213107'),
(267, 3, 78, 'selDtlG', 'DTL', 3, 'R', 'RTN_SELECT_LIST', 0, 'select\n	CD,NM,CDDESC,PCD,ORD\n	,CDVAL,CDVAL2,CDMIN,CDMAX,DATATYPE\n	,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT,MODDT\nfrom CG_CODED\nwhere PCD = #{G2-PCD} \norder by ORD ', 0, '20190528215719', '20190608172105'),
(268, 3, 78, 'insMasG', 'MAS', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODE (\n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT\n) values (\n	#{PCD},#{PNM},#{PCDDESC},if(#{ORD}=\'\',\'10\',#{ORD})\n	,#{UITOOL},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', NULL, '20190528215720', NULL),
(269, 3, 78, 'insDtlG', 'DTL', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODED (\n	CD,NM,CDDESC,PCD\n	,ORD,CDVAL,CDVAL2,CDMIN,CDMAX\n	,DATATYPE,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT\n) values (\n	#{CD},#{NM},#{CDDESC},#{PCD}\n	,if(#{ORD}=\'\',10,#{ORD}),#{CDVAL},#{CDVAL2},#{CDMIN},#{CDMAX}\n	,#{DATATYPE},#{EDITYN},#{FORMATYN},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', NULL, '20190528215720', NULL),
(270, 3, 78, 'updMasG', 'MAS', 3, 'U', 'RTN_INT', 0, 'update CG_CODE set\n	PNM = #{PNM}, PCDDESC = #{PCDDESC}, ORD = #{ORD}, UITOOL = #{UITOOL}, USEYN = #{USEYN}\n	, DELYN = #{DELYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere PCD = #{PCD}\n', NULL, '20190528215720', NULL),
(271, 3, 78, 'updDtlG', 'DTL', 3, 'U', 'RTN_INT', 10, 'update  CG_CODED set\n	NM = #{NM}, CDDESC = #{CDDESC},ORD = #{ORD}, CDVAL = #{CDVAL}, CDVAL2 = #{CDVAL2}\n	, CDMIN = #{CDMIN}, CDMAX = #{CDMAX}, DATATYPE = #{DATATYPE}, EDITYN = #{EDITYN}, FORMATYN = #{FORMATYN}\n	, USEYN = #{USEYN}, DELYN = #{DELYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere  PCD = #{PCD} and CD = #{CD}\n', 0, '20190528215720', '20190608124739'),
(272, 3, 78, 'delDtlG', 'DTL', 3, 'D', 'RTN_INT', 0, 'delete from CG_CODED \nwhere PCD = #{PCD} and CD = #{CD}\n', NULL, '20190528215721', NULL),
